const array = require('lodash/array');
class Map {
  constructor(params) {
    this.name = params.name
    this.imgSrc = params.imgSrc
    this.grid = params.grid
    this.width = params.grid[0].length * Map.tileSize
    this.height = params.grid.length * Map.tileSize
    Map.list[this.name] = this
  }

  static getAllInitData() {
    const maps = []
    for (let i in Map.list) { maps.push(Map.list[i].initialData) }
    return maps
  }

  static generateMaps() {
    const array2DForest = array.chunk(arrayTileForest, 80)
    new Map({ name: 'forest', imgSrc: '/client/images/map1.png', grid: array2DForest })
    new Map({ name: 'pvp-forest', imgSrc: '/client/images/PvP-Forest.png', grid: array2DForest })
    const array2DCave = array.chunk(arrayTileCave, 30)
    new Map({ name: 'cave', imgSrc: '/client/images/CaveMap.png', grid: array2DCave })
  }

  get initialData() {
    return {
      name: this.name,
      imgSrc: this.imgSrc
    }
  }

  isPositionMapBorder(entity) {
    if (entity.x > this.width || entity.x < 0) {
      return 'x'
    }
    if (entity.y > this.height || entity.y < 0) {
      return 'y'
    }
  }

  isPositionWall(entity) {
    const gridX = Math.floor(entity.x / Map.tileSize)
    const gridY = Math.floor(entity.y / Map.tileSize)
    if (entity.x > this.width ||
      entity.x < 0 ||
      entity.y > this.height ||
      entity.y < 0) {
      return true
    }
    if (gridX < 0 || gridX >= this.grid[0].length)
      return true
    if (gridY < 0 || gridY >= this.grid.length)
      return true
    return this.grid[gridY][gridX]
  }


  isPositionCaveEntry(entity) {
    // Maps with no cave entrances
    if (this.name === 'pvp-forest') {
      return false
    }
    const gridX = Math.floor(entity.x / Map.tileSize)
    const gridY = Math.floor(entity.y / Map.tileSize)
    // Maps with cave entrances
    if (this.name === 'forest') {
      return (this.grid[gridY][gridX] === 934)
    }
    if (this.name === 'cave') {
      return (this.grid[gridY][gridX] === 29)
    }
  }
}
